INSERT INTO `tbl_blog` (`id`, `titulo`, `postado_por`, `conteudo`, `data_postagem`, `especialidade`, `foto`, `breve`, `meta_title`, `meta_keywords`, `meta_description`, `foto1`, `url_amigavel`, `descricao_imagem`, `legenda_imagem`) VALUES
(7, 'Diferenças entre a energia solar térmica e a fotovoltaica', 'Pico Solar', '<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A energia solar cresce em ritmo progressivo, sendo considerada, hoje, uma das fontes mais usadas de energias renováveis, podendo ser utilizada tanto em indústrias como em residências. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">O que é energia solar</span></span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A energia solar é a energia gerada a partir da luz do sol e que pode ser aproveitada por diferentes tecnologias, como: aquecimento solar, energia solar fotovoltaica e energia heliotérmica.</span></span></span></p>\r\n\r\n<h6 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">É uma energia: </span></span></h6>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Alternativa </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Renovável </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Sustentável </span></span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\"><strong>Alternativa:</strong> que vem de várias fontes de energia renováveis, como: </span></span></span></p>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Energia solar </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Eólica </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Hídrica (ou hidráulica) </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Geotérmica.</span></span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\"><strong>Renovável:</strong> obtida de recursos naturais que são naturalmente reabastecidos, como: </span></span></span></p>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Chuva</span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Sol </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Marés </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Vento </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Energia Geotérmica. </span></span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\"><strong>Sustentável:</strong> é a energia elétrica obtida de fontes renováveis e gerada sem grandes impactos ao meio ambiente, como: emissão de gases ou agravamento dos impactos ambientais.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">Características da energia solar</span></span></h5>\r\n\r\n<h6 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">Além das já citadas, as outras características da energia solar são:</span></span></h6>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Não gera resíduos, por isso, energia limpa</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">É uma fonte de energia gratuita</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Gera economia de mais de 90% na conta de luz</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Possui vida útil de mais de 20 anos, com pouca ou nenhuma manutenção.</span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A energia do sol é considerada inesgotável e incomparável com todas as outras fontes de energia, pela qualidade e capacidade ilimitada de fornecimento. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">O conceito de energia solar confunde-se com o da energia fotovoltaica, que é a geração de energia elétrica usando a luz do sol como fonte. Podendo-se dizer serem a mesma coisa.</span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Na energia solar fotovoltaica, a luz do sol é captada por painéis solares e transformada em corrente elétrica. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">A energia solar térmica</span></span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A energia solar térmica usa o sol para aquecer fluidos e costuma ser usada para aquecer ambientes ou processos industriais. É extremamente eficiente e reduz o consumo de energia em aproximadamente 80%.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">A energia solar fotovoltaica</span></span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Em um sistema fotovoltaico, as células de silício dos painéis geram corrente elétrica ao serem expostas ao sol. Esta energia é tratada por equipamentos elétricos, para que ela fique com as características certas para o consumo.</span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">O sistema solar fotovoltaico é composto por:</span></span></p>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Painéis solares</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Inversor Solar</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Sistema de fixação das placas solares</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Cabeamentos</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Conectores, etc.</span></span></span></li>\r\n</ul>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Em conclusão, a energia solar térmica é destinada ao aquecimento e a energia solar fotovoltaica vai gerar eletricidade. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">Como usar </span></span></h5>\r\n\r\n<h6 dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\">Existem inúmeras formas de aproveitamento da energia solar, são elas:</span></span></h6>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Aquecimento de água</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Geração de energia elétrica</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Iluminação pública</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Sistemas de uso coletivo, tais como geração de energia elétrica para escolas, postos de saúde e centros comunitários.</span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#7f8c8d\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A Pico Solar conta com tecnologia de ponta, profissionais altamente qualificados, instalação rápida e projetos individualizados. </span></span></span><br />\r\n </p>\r\n', '2021-01-07', NULL, '1610051681.6-foto-N.jpg', 'Você sabe o que diferencia cada uma das fontes mais usadas de energia solar? Confira o post para saber mais.', 'Diferenças entre a energia solar térmica e a fotovoltaica - Pico Solar | (61) 98296-5547', '', 'A Pico Solar fornece soluções completas em Energia Solar Fotovoltaica. Energia alternativa, renovável, limpa e inesgotável. Energia solar convertida em economia. ', NULL, 'diferencas-entre-energia-solar-termica-fotovoltaica', '', ''),
(8, 'Reciclagem de placas solares ', 'Pico Solar', '<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">As fontes alternativas de geração de energia têm ganhado bastante importância nos últimos anos. Uma destas alternativas é a energia solar, fonte sustentável, limpa e inesgotável, além de gerar baixo impacto ambiental comparado a outras fontes de energia. </span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">Materiais que compõem a placa solar</span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A coleta dessa energia vinda do sol e a sua conversão em energia elétrica são feitas através das placas fotovoltaicas, que são placas solares feitas de polímeros plásticos, alumínio, silício, cobre, prata, estanho, zinco e chumbo. Materiais nobres com alto valor de mercado. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Após o período de vida útil, uma vez que esses painéis solares tem cerca de 25 a 35 anos de funcionamento perfeito (e alguns modelos podem chegar aos 40 anos), as placas e seus componentes podem ser quase que totalmente reciclados, ao invés de se tornarem resíduos de lixo eletrônico. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A reciclagem é a última etapa para o ciclo sustentável da energia solar e o seu custo é considerado bastante baixo, além da eficiência de recuperação dos materiais ser satisfatória.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">A vida útil das placas solares</span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Como dissemos acima, a média é de 30 anos de vida útil dos painéis fotovoltaicos, mas a maioria dos fabricantes afirma ocorrer uma diminuição de 20% na capacidade de energia por volta dos 25 anos.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">É comum ocorrer uma queda de 6 a 8% após 20 anos de uso das placas, mas o tempo de utilização, de forma eficiente, é muito maior do que o afirmado pelos fabricantes. Aqueles de alta qualidade podem chegar aos 30 a 40 anos e continuarem funcionando normalmente, embora com eficácia decrescente.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"> </span></span><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"> </span></span></span></p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">A legislação</span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">No Brasil, acordos estão sendo feitos para que haja o correto descarte dos painéis fotovoltaicos, a fim de que a expansão do mercado de energia solar cresça de forma consistente e equilibrada. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Especialistas do setor estudam a criação de uma nova lei que classifique os resíduos fotovoltaicos como especiais, além da implementação e fiscalização pelo IBAMA. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">No momento, a lei 12.305/2010 trata da política nacional de resíduos sólidos e os resíduos de painéis fotovoltaicos ainda se enquadram na classificação geral de resíduos. Existe uma única exceção onde são definidos como lixo eletrônico, na Diretiva de Resíduos de Equipamentos Elétricos e Eletrônicos. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Os fabricantes de placas solares estão obrigados por lei a cumprir requisitos legais específicos e padrões de reciclagem para garantir que os painéis não se tornem um fardo para o meio ambiente.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Outras leis falam de isenções de impostos e compensação de energia solar.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">A reciclagem </span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O processo de reciclagem traz uma série de benefícios para o meio ambiente. Por meio dele, grandes quantidades de plástico, metais e vidro podem ser recuperados e reinseridos na composição de novos produtos. Isso significa que o processo seria ainda mais sustentável e ecológico.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">De acordo com o programa da Agência Internacional de Energia Renovável (IRENA), até 2050 os painéis fotovoltaicos poderão ser reciclados e recuperados em cerca de 2 milhões de unidades.  </span></span></span></p>\r\n\r\n<h5 dir=\"ltr\"> </h5>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">Existem dois processos utilizados para a reciclagem de placas solares: </span></h5>\r\n\r\n<ul dir=\"ltr\" style=\"margin-left:40px\">\r\n	<li><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Térmico </span></span></span></li>\r\n	<li><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Mecânico.</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"> </span></span></span></p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">Reciclagem térmica</span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Essa técnica de reciclagem é baseada no tratamento térmico e envolve a queima. É aplicável à 80% do painel. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Após isso, diferentes processos químicos são realizados para remover a camada anti-reflexo e separar os contatos de metal. As borrachas de silicone também podem ser reutilizadas e, inclusive, recicladas mais de uma vez.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"> </span></span></span></p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#7f8c8d\">Reciclagem mecânica</span></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Esta segunda técnica consiste em moer todo o painel transparente de sua estrutura e aplicar processos químicos. O material é triturado e depois processado. A reciclagem mecânica é realizada em usinas de reciclagem.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"> </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A Pico Solar conta com tecnologia de ponta, profissionais altamente qualificados, instalação rápida e projetos individualizados. </span></span></span></p>\r\n', '2021-01-11', NULL, '1610395954.4-foto-N.jpg', 'Você sabe como funciona a tecnologia para a reciclagem de painéis solares? Confira o post para saber mais.', 'Reciclagem de placas solares  - Pico Solar  | (61) 98296-5547', '', 'A Pico Solar fornece soluções completas em Energia Solar Fotovoltaica. Energia alternativa, renovável, limpa e inesgotável. Energia solar convertida em economia.', NULL, 'reciclagem-placas-solares', '', ''),
(9, 'Métodos de obtenção de energia solar', 'Pico Solar', '<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">Os principais benefícios da energia solar</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os sistemas de geração de energia solar utilizam energia limpa e renovável do sol, transformada em energia elétrica. Painéis solares ajudam a evitar e combater as emissões de gases do efeito estufa e, a longo prazo, reduzir drasticamente a nossa dependência de combustíveis fósseis, como o petróleo.</span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Em  comparação:</span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Um sistema fotovoltaico de 6kWp seria equivalente a 10 campos de futebol em árvores, ou a água de 6 piscinas olímpicas, ou 79 toneladas de carvão queimado, ou 500.000 km rodados de gasolina.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">Os métodos de obtenção da energia fotovoltaica podem ser classificados em: </span></span></h5>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Diretos ou indiretos </span></span></span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Passivos ou ativos.</span></span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">A classificação da energia solar</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Primária ou secundária </span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">A energia solar é energia primária, porque não precisa ser transformada ou convertida, para funcionar. As fontes de energia primária consistem em toda forma de energia vinda da natureza, como a luz do sol.</span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">E elas não necessitam de outra alternativa para a sua geração energética. Por isso, seu custo-benefício já sai na frente de muitas outras fontes, em virtude da economia e simplicidade no processo de produção de energia.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">A produção de energia solar quando não tem sol</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os painéis solares também funcionam em dias nublados e chuvosos, já que mesmo nessas condições, há incidência de raios violetas. A produção varia em dias cinzentos, mas não deixa de existir. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">À noite, não há captação, mas o armazenamento de energia é feito por meio de baterias.</span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Em conclusão, a energia solar é captada dos raios ultravioleta e não do calor do sol, mas, quando há incidência solar o rendimento é bem maior. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">A expertise de um profissional</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">É necessário que um profissional avalie a média de insolação da região onde será feita a instalação e calcule a capacidade energética. Com isso, será possível evitar um baixo desempenho em dias nublados ou chuvosos, já que o cálculo será feito com base na posição do sol, no índice solar durante o ano e na duração do dia.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">Sistemas Diretos e Indiretos</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Direto</span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os métodos diretos são aqueles que precisam de apenas uma etapa para obter a energia do sol e transformá-la em elétrica. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Exemplo: Energia Solar Fotovoltaica, a energia solar é obtida quando atinge uma célula fotovoltaica, criando eletricidade.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Indireto</span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os métodos indiretos são os que precisam de duas ou mais etapas para converter a energia solar em energia utilizável. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Exemplo: Energia heliotérmica, a energia solar atinge os espelhos refletores, que concentram o calor em um tubo a vácuo, por onde passa água e esta é transformada em vapor, alimentando uma turbina que gera energia elétrica.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<h5 dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\">Sistema Passivos e Ativos de Energia Solar</span></span></h5>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Passivo</span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os sistemas passivos de energia solar são normalmente diretos. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Exemplo: uma estufa que transfere o calor do sol para o ar, mantendo o ambiente quente. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><strong><span style=\"font-size:18px\">Ativo</span></strong></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Os sistemas ativos de energia solar funcionam com o auxílio de dispositivos mecânicos para melhorar o desempenho da coleta da energia solar. </span></span></span></p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">Exemplo: sistema de aquecimento solar que utiliza uma bomba para forçar a circulação de água. </span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">A energia solar é uma das alternativas mais econômicas e sustentáveis, contando com instalação simples e manutenção mínima. E com anos e anos de vida útil.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p dir=\"ltr\" style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"color:#7f8c8d\"><span style=\"font-size:18px\">A Pico Solar conta com tecnologia de ponta, profissionais altamente qualificados, instalação rápida e projetos individualizados. </span></span></span></p>\r\n\r\n<p> </p>\r\n', '2021-01-11', NULL, '1610396143.29-foto-N.jpg', 'Você sabe quais são os métodos de obtenção de energia solar? Confira o post para saber mais.', 'Métodos de obtenção de energia solar - Pico Solar | (61) 98296-5547', '', 'A Pico Solar fornece soluções completas em Energia Solar Fotovoltaica. Energia alternativa, renovável, limpa e inesgotável. Energia solar convertida em economia.', NULL, 'metodos-obtencao-energia-solar', '', ''),
(10, 'Conhecendo o conceito Net Metering', 'Pico Solar', '<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O que sobra da sua energia fotovoltaica transformada em créditos.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><br />\r\n<span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O Brasil vem criando oportunidades para aumentar a popularidade e conhecimento da energia fotovoltaica no âmbito da energia nacional. Atualmente, já somos mais familiarizados com os conceitos de energias alternativas, e muitas residências já fazem uso dessas tecnologias. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Nesse segmento, surge o <em>net metering</em>: traduzido como <strong>Sistema de Compensação de Energia</strong>, ele incentiva o uso de fontes de energias renováveis seguindo um sistema que permite que a energia excedente da que foi absorvida, e não utilizada, seja transformada em créditos que servem de descontos no consumo da energia elétrica em uma residência, por exemplo. </span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#999999\"> <span style=\"font-family:Open Sans,sans-serif\">Como funciona?</span> </span></h5>\r\n\r\n<p dir=\"ltr\"> </p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Essa energia que sobra é injetada na rede distribuidora, que armazena esse excedente tal qual uma bateria. O momento em que a energia injetada for maior que a energia consumida, é quando o consumidor recebe o crédito em energia, que pode ser usado para diminuir o consumo em termos de tarifa e, se ainda sobrarem créditos, podem ser usados para abastecer outra propriedade.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<h5 dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:14px\"><span style=\"font-family:Open Sans,sans-serif\">Por que contar com o Net Metering?</span></span></span></h5>\r\n\r\n<p dir=\"ltr\"> </p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Ao proporcionar mais autonomia ao consumidor, a compensação de energia torna o usuário menos dependente das distribuidoras de energia convencionais.<br />\r\nAlém de causar menos impacto ao meio ambiente, por fazer uso de uma energia renovável e ilimitada, o fator mais estimulante é enxergar o <em>net metering</em> como um investimento. </span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Sabendo que existe a possibilidade de uso dos créditos extras em outras residências, a economia financeira é real e contábil. A TUST e a TUSD, tarifas pagas na compra da energia elétrica diretamente dos agentes de comercialização ou de geração no mercado livre de energia elétrica, podem ser reduzidas em até metade de seus valores quando usadas por instalações que geram sua própria energia. O net metering é vantajoso para residências, indústrias e comércio.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">É bom destacar que os créditos são em quilowatts-hora, e não em dinheiro. A forma de fazer economia é em termos de energia; quando o consumidor da compensação de energia possui imóveis na mesma titularidade, pode transferir esses créditos para a sua rede, desde que façam parte da mesma distribuidora de energia pública.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Aos poucos as alternativas em energia se mostram mais presentes no Brasil, apresentando benefícios e resultados positivos.</span></span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:#999999\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Aqui na Pico Solar, nossos profissionais estão prontos e qualificados para te ajudar no processo de investir em economia e independência energética.</span></span></span></p>\r\n', '2021-03-11', NULL, '1615475970.64-foto-N.jpg', 'Você conhece o termo Net Metering e suas vantagens? Confira o post para saber mais.', 'Conhecendo o conceito Net Metering - Pico Solar  | (61) 98296-5547', '', 'A Pico Solar fornece soluções completas em Energia Solar Fotovoltaica. Energia alternativa, renovável, limpa e inesgotável. Energia solar convertida em economia. ', NULL, 'conhecendo-conceito-net-metering', '', '');
