INSERT INTO `tbl_servicos_consular` (`id`, `titulo`, `titulo_en`, `titulo_th`, `descricao`, `descricao_en`, `descricao_th`, `id_cat`, `meta_title`, `meta_keywords`, `meta_description`, `foto`, `url_amigavel`) VALUES
(1, 'Informação sobre Visto', 'Visa Information', 'ทดสอบ', '<p>1. Geralmente, um cidadão estrangeiro que deseja entrar no Reino da Tailândia deve obter um visto na Embaixada Real da Tailândia ou no Consulado Geral Real da Tailândia. No entanto, os cidadãos de certos países não precisam de visto se cumprirem os requisitos de isenção de visto como segue:</p>\r\n\r\n<p>               (1) eles são nacionais de países que estão isentos da obrigação de visto para entrar na Tailândia para fins turísticos. Isso inclui o Brasil. </p>\r\n\r\n<p>               (2) são nacionais de países que possuem acordos bilaterais com a Tailândia sobre a isenção da obrigação de visto.</p>\r\n\r\n<p>    2. Cidadãos de certos países podem solicitar visto ao chegar na Tailândia. Os viajantes com este tipo de visto têm permissão para entrar e permanecer na Tailândia por um período não superior a 15 dias.</p>\r\n\r\n<p>    3. Os viajantes que viajam de / através de países que foram declarados como áreas infectadas com febre amarela devem adquirir um certificado internacional de saúde que comprove o recebimento da vacina contra febre amarela. Isso inclui cidadãos do Brasil, Guiana e Suriname.</p>\r\n\r\n<p>    4. Cidadãos de certos países são obrigados a solicitar um visto apenas na Embaixada Real da Tailândia ou no Consulado Geral Real da Tailândia no país de residência do requerente, ou na Embaixada Real da Tailândia que tem jurisdição sobre seu país de residência. Os viajantes são fortemente aconselhados a primeiramente consultar o departamento autorizado para a emissão de vistos da Embaixada Real da Tailândia em Brasília.</p>\r\n\r\n<p>    5. Para solicitar um visto, o estrangeiro deve possuir um passaporte válido ou documento de viagem que seja reconhecido pelo Governo Real da Tailândia e cumprir as condições estabelecidas na Lei de Imigração da Tailândia B.E.2522 (1979) e seus regulamentos relevantes. Além disso, o requerente do visto deve estar fora da Tailândia no momento da aplicação. O solicitante receberá um tipo de visto de acordo com o propósito de sua visita. Para obter mais informações sobre os tipos de visto e requisitos gerais para cada tipo de visto, consulte Tipos de visto e Emissão de visto.</p>\r\n\r\n<p>    7. Observe que o período de validade do visto é diferente do período de permanência. A validade do visto é o período durante o qual um visto pode ser usado para entrar na Tailândia. Em geral, a validade de um visto é de 3 meses, mas em alguns casos, os vistos podem ser emitidos para serem válidos por 6 meses, 1 ano, 3 anos ou 5 anos. A validade de um visto concedido com discrição pela Embaixada Real da Tailândia ou Consulado Geral Real da Tailândia, sendo exibida na vinheta do visto concedido.</p>\r\n\r\n<p>    8. Por outro lado, o período de estada é concedido por um oficial de imigração à chegada ao porto de entrada e de acordo com o tipo de visto do viajante. Por exemplo, o período de permanência para um visto de trânsito não excede 30 dias, para um visto de turista não excede 60 dias e para um visto de não-imigrante não excede 90 dias a partir da data de chegada. O período de permanência concedido pelo oficial de imigração é exibido no carimbo de chegada/entrada no país. Os viajantes que desejarem permanecer mais tempo do que esse período pode solicitar prorrogação da estadia nos escritórios do Immigration Bureau em Bangkok, localizados no Government Center B, Chaengwattana Soi 7, Laksi, Bangkok 10210, Tel 0-2141-9889 ou em um escritório de imigração localizado nas províncias. Para obter informações sobre o pedido de prorrogação da estadia, consulte o site do Immigration Bureau em <a href=\"https://thaiembassyinbrazil.com/www.immigration.go.th\" target=\"_blank\">aqui</a>.</p>\r\n\r\n<p>    9. Estrangeiros que entram na Tailândia não têm permissão para trabalhar, independentemente do tipo de visto, a menos que recebam uma autorização de trabalho. Aqueles que pretendem trabalhar na Tailândia devem possuir o tipo correto de visto para serem elegíveis para solicitar uma autorização de trabalho. Informações sobre os pedidos de autorização de trabalho podem ser obtidas no site do Office of Foreign Workers Administration, Departamento de Emprego, Ministério do Trabalho em <a href=\"https://thaiembassyinbrazil.com/www.doe.go.th/workpermit/index.html\" target=\"_blank\">aqui</a>.</p>\r\n\r\n<p>    10. As Embaixadas Reais da Tailândia e os Consulados Gerais Reais da Tailândia têm autoridade para emitir vistos a estrangeiros para viajarem para a Tailândia. A autoridade para permitir a entrada e permanência na Tailândia, entretanto, é dos Oficiais de Imigração. Em alguns casos, o Oficial de Imigração pode não permitir que um estrangeiro com um visto válido entre na Tailândia, caso o oficial de imigração encontre motivos para acreditar que ele se enquadra na categoria de estrangeiros proibidos de entrar na Tailândia de acordo com a Lei de Imigração B.E. 2522 (1979).</p>\r\n\r\n<p>    11. De acordo com a Lei de Imigração da Tailândia B.E. 2522 (1979), os estrangeiros que se enquadram em qualquer uma das seguintes categorias estão proibidos de entrar na Tailândia:</p>\r\n\r\n<p>               (1) Não ter passaporte genuíno válido ou documento usado no lugar do passaporte; ou ter um passaporte ou documento genuíno válido usado no lugar do passaporte sem a emissão de visto válido pelas Embaixadas Reais da Tailândia, pelos Consulados Gerais Reais da Tailândia ou pelo Ministério dos Negócios Estrangeiros, com exceção daqueles que atendem aos requisitos de isenção de visto. Os termos e condições de emissão e isenção de visto são prescritos pelos Regulamentos Ministeriais.</p>\r\n\r\n<p>               (2) Não tendo meios adequados de se manter após a entrada no Reino.</p>\r\n\r\n<p>               (3) Ter entrado no Reino para ser empregado como trabalhador não-qualificado ou não treinado, ou para trabalhar em violação da Lei de Permissão de Trabalho para Estrangeiros.</p>\r\n\r\n<p>               (4) Ser mentalmente instável ou ter qualquer uma das doenças declaradas nos Regulamentos Ministeriais.</p>\r\n\r\n<p>               (5) Não ter ainda sido vacinado contra a varíola; ou inoculado, ou submetido a qualquer outro tratamento médico para proteção contra doenças; e ter recusado que tais vacinações fossem administradas pelo Médico da Imigração.</p>\r\n\r\n<p>               (6) Tendo sido preso por sentença do Tribunal Tailandês; ou por injunção legal ou decisão do Tribunal de um país estrangeiro, exceto quando a pena for por pequenas infrações, ou negligência, ou for prevista como exceção pelos Regulamentos Ministeriais.</p>\r\n\r\n<p>               (7) Ter comportamento que possa causar possível perigo ao público; ou ter a probabilidade de ser um incômodo ou constituir qualquer violência à paz, segurança e proteção do público ou à segurança da nação; ou estar sob ordem de prisão por funcionários competentes de governos estrangeiros.</p>\r\n\r\n<p>               (8) Razão para acreditar que a entrada no Reino é com o propósito de se envolver em prostituição, tráfico de mulheres ou crianças, contrabando de drogas ou outros tipos de contrabando que são contra a moralidade pública.</p>\r\n\r\n<p>               (9) Não ter dinheiro ou caução conforme prescritos pelo Ministro sob a Seção 14 da Lei de Imigração B.E. 2522 (1979).</p>\r\n\r\n<p>               (10) Ser uma pessoa proibida pelo Ministro de acordo com a Seção 16 do Immigration Act B.E. 2522 (1979).</p>\r\n\r\n<p>               (11) Ter sido deportado pelo Governo da Tailândia ou de outros países estrangeiros; ou tendo sido revogado o direito de permanência no Reino ou no estrangeiro; ou tendo sido expulso do Reino por funcionários competentes às custas do Governo da Tailândia, a menos que a isenção seja fornecida pelo Ministro em caso singular específico.</p>\r\n', '<p>1. Generally, a foreign citizen who wishes to enter the Kingdom of Thailand is required to obtain a visa from a Royal Thai Embassy or a Royal Thai Consulate-General.  However, nationals of certain countries do not require a visa if they meet visa exemption requirements as follows:</p>\r\n\r\n<p>(1) they are nationals of countries which are exempted from visa requirements when entering Thailand for tourism purposes. This includes Brazil. </p>\r\n\r\n<p>(2) they are nationals of countries which hold bilateral agreements with Thailand on the exemption of visa requirements.  </p>\r\n\r\n<p> </p>\r\n\r\n<p>2. Nationals of certain countries may apply for visa upon arrival in Thailand. Travellers with this type of visa are permitted to enter and stay in Thailand for a period of not exceeding 15 days.  </p>\r\n\r\n<p>3. Travellers travelling from/through countries which have been declared Yellow Fever Infected Areas must acquire an International Health Certificate verifying the receiving of a Yellow Fever vaccination. This includes nationals of Brazil, Guyana and Suriname.</p>\r\n\r\n<p>4. Nationals of certain countries are required to apply for a visa only at the Royal Thai Embassy or the Royal Thai Consulate-General in the applicant’s country of residence, or at the Royal Thai Embassy which has jurisdiction over his or her country of residence.  Travellers are advised to enquire about authorised office for visa issuance at the Royal Thai Embassy in Brasilia first. </p>\r\n\r\n<p>5. To apply for a visa, a foreigner must possess a valid passport or travel document that is recognised by the Royal Thai Government and comply with the conditions set forth in the Immigration Act of Thailand B.E.2522 (1979) and its relevant regulations.  In addition, the visa applicant must be outside of Thailand at the time of application.  The applicant will be issued with a type of visa in accordance to his or her purpose of visit.  For more information on types of visas and general requirements for each type of visa, please see Types of Visa and Issuance of Visa.</p>\r\n\r\n<p>7. Please note that the period of visa validity is different from the period of stay. Visa validity is the period during which a visa can be used to enter Thailand.  In general, the validity of a visa is 3 months, but in some cases, visas may be issued to be valid for 6 months, 1 year , 3 years or 5 years.  The validity of a visa is granted with discretion by the Royal Thai Embassy or Royal Thai Consulate-General and is displayed on the visa sticker. </p>\r\n\r\n<p>8. On the other hand, the period of stay is granted by an immigration officer upon arrival at the port of entry and in accordance with the type of visa.  For example, the period of stay for a transit visa is not exceeding 30 days, for a tourist visa is not exceeding 60 days and for a non-immigrant visa is not exceeding 90 days from the arrival date.  The period of stay granted by the immigration officer is displayed on the arrival stamp.  Travellers who wish to stay longer than such period may apply for extension of stay at offices of the Immigration Bureau in Bangkok, located at Government Center B, Chaengwattana Soi 7, Laksi, Bangkok 10210, Tel 0-2141-9889 or at an Immigration office located in the provinces. For information on application for extension of stay, see the Immigration Bureau website at <a href=\"https://thaiembassyinbrazil.com/www.immigration.go.th\" target=\"_blank\">here</a>.</p>\r\n\r\n<p>9. Foreigners entering Thailand are not permitted to work, regardless of their types of visa, unless they are granted a work permit.  Those who intend to work in Thailand must hold the correct type of visa to be eligible to apply for a work permit.  Information on Work Permit applications could be obtained from the website of the Office of Foreign Workers Administration, Department of Employment, Ministry of Labour at <a href=\"https://thaiembassyinbrazil.com/www.doe.go.th/workpermit/index.html\" target=\"_blank\">here</a>.</p>\r\n\r\n<p>10.  Royal Thai Embassies and Royal Thai Consulates-General have the authority to issue visas to foreigners for travel to Thailand.  The authority to permit entry and stay in Thailand, however, is with the immigration officers.  In some cases, the immigration officer may not permit foreigner holding a valid visa entry into Thailand should the immigration officer find reason to believe that he or she falls into the category of aliens prohibited from entering Thailand under the Immigration Act B.E. 2522 (1979).</p>\r\n\r\n<p>11. According to the Immigration Act of Thailand B.E. 2522 (1979), foreigners who fall into any of the following categories are prohibited to enter Thailand:</p>\r\n\r\n<p>(1)  Having no genuine valid passport or document used in lieu of passport; or having a genuine valid passport or document used in lieu of passport without valid visa issuance by the Royal Thai Embassies, the Royal Thai Consulates-General or the Ministry of Foreign Affairs, with exception of those who meet visa exemption requirements.  The terms and conditions of visa issuance and visa exemption are prescribed by the Ministerial Regulations.</p>\r\n\r\n<p>(2)  Having no appropriate means of living following entry into the Kingdom.</p>\r\n\r\n<p>(3)  Having entered the Kingdom to be employed as an unskilled or untrained labourer, or to work in violation of the Alien Work Permit Law.</p>\r\n\r\n<p>(4)  Being mentally unstable or having any of the diseases stated in the Ministerial Regulations.</p>\r\n\r\n<p>(5)  Having not yet been vaccinated against smallpox; or inoculated, or undergone any other medical treatment for protection against disease; and having refused to have such vaccinations administered by the Immigration Doctor.</p>\r\n\r\n<p>(6)  Having been imprisoned by judgment of the Thai Court; or by lawful injunction or judgment of the Court of a foreign country, except for when the penalty is for a petty offence, or negligence, or is provided for as an exception by the Ministerial Regulations.</p>\r\n\r\n<p>(7)  Having behaviour which could cause possible danger to the public; or having the likelihood of being a nuisance or constituting any violence to the peace, safety and security of the public or to the security of the nation; or being under warrant of arrest by competent officials of foreign governments.</p>\r\n\r\n<p>(8)  Reason to believe that entry into Kingdom is for the purpose of being involved in prostitution, the trafficking of women or children, drug smuggling, or other types of smuggling which are against public morality.</p>\r\n\r\n<p>(9)  Having no money or bond as prescribed by the Minister under Section 14 of the Immigration Act B.E. 2522 (1979).</p>\r\n\r\n<p>(10)  Being a person prohibited by the Minister under Section 16 of the Immigration Act B.E. 2522 (1979).</p>\r\n\r\n<p>(11)  Being deported by either the Government of Thailand or that of other foreign countries; or having been revoked the right of stay in the Kingdom or in foreign countries; or having been expelled from the Kingdom by competent officials at the expense of the Government of Thailand unless exemption is provided by the Minister on an individual basis.</p>\r\n', '<p>ทดสอบ</p>\r\n', NULL, '', '', '', '1674992769.9604-foto-N.png', 'informacao-sobre-visto'),
(2, 'Como requerer um visto', 'How to apply for a Thai Visa', '', '<p>ETAPA 1:</p>\r\n\r\n<p>Escolha o tipo de visto de acordo com o propósito da visita e prepare os documentos necessários e dois formulários de solicitação de visto</p>\r\n\r\n<p> </p>\r\n\r\n<p>ETAPA 2:</p>\r\n\r\n<p>Agende uma reunião para submeter sua solicitação de visto na Embaixada Real da Tailândia em Brasília, juntamente com a taxa de processamento do visto</p>\r\n\r\n<p> </p>\r\n\r\n<p>ETAPA 3:</p>\r\n\r\n<p>Sua solicitação e os documentos de apoio serão analisados pela Embaixada Real da Tailândia. Por favor, aguarde até 7 dias para este processo. (* NOTA No caso de o requerente não apresentar todos os documentos exigidos, ou por outros motivos considerados pela Embaixada, o pedido pode ser rejeitado sem reembolso da taxa de processamento de visto)</p>\r\n\r\n<p> </p>\r\n\r\n<p>ETAPA 4:</p>\r\n\r\n<p>Processo de emissão de visto (aprovar / rejeitar)</p>\r\n\r\n<p> </p>\r\n\r\n<p>ETAPA 5:</p>\r\n\r\n<p>Se aprovado, a Embaixada irá informá-lo quando recolher o seu visto em um agendamento que será marcado.</p>\r\n', '<p>STEP 1: </p>\r\n\r\n<p>Choose your visa type in accordance with your purpose of visit and prepare the required documents and two visa application forms</p>\r\n\r\n<p> </p>\r\n\r\n<p>STEP 2: </p>\r\n\r\n<p>Make an appointment to submit your application at the Royal Thai Embassy in Brasilia along with the visa processing fee</p>\r\n\r\n<p> </p>\r\n\r\n<p>STEP 3: </p>\r\n\r\n<p>The application and supporting documents will be reviewed by the Royal Thai Embassy. Please allow up to 7 days for this process. (*NOTE In case the applicant fails to submit all the required documents, or other reasons as deemed by the Embassy, the application may be rejected without refunding the visa processing fee</p>\r\n\r\n<p> </p>\r\n\r\n<p>STEP 4: </p>\r\n\r\n<p>Visa Issuance process (Approve / Reject)</p>\r\n\r\n<p> </p>\r\n\r\n<p>STEP 5: </p>\r\n\r\n<p>If approved, the Embassy will inform you collect your visa on the appointment date</p>\r\n', '', NULL, '', '', '', '1674992724.5903-foto-N.png', 'como-requerer-visto'),
(3, 'Tipos de Vistos Tailandeses e Taxas', 'Types of Visas and Fees', '', '<p>Tipos de vistos tailandeses</p>\r\n\r\n<p>    1. <a href=\"http://embaixadatailandia.web15f38.uni5.net/site/tipos_visto.php?id_m=56&amp;id=1492\" target=\"_blank\">Visto de Turismo </a></p>\r\n\r\n<p>    2. <a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1495\" target=\"_blank\">Visto de Não-Imigrante</a></p>\r\n\r\n<p>    3. <a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1500\" target=\"_blank\">Visto de Trânsito</a> (Os vistos estão temporariamente suspensos até novo aviso)</p>\r\n\r\n<p>    4.<a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1503\" target=\"_blank\"> </a><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1503\" target=\"_blank\">Visto Diplomático/Oficial</a></p>\r\n\r\n<p>    5. <a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1509\" target=\"_blank\">SMART Visa</a></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p>Taxas de Vistos</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Nº</th>\r\n			<th>Categoria de Vistos</th>\r\n			<th>Taxas (Reais Brasileiros)</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>1</td>\r\n			<td>Visto de Trânsito</td>\r\n			<td>USD$35,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2</td>\r\n			<td>Visto de Turismo (Entrada Única)</td>\r\n			<td>USD$40,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>3</td>\r\n			<td>Visto de Turismo (Entradas Múltiplas)</td>\r\n			<td>USD$200,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>4</td>\r\n			<td>Visto de Não-Imigrante<br />\r\n			Entrada única com validade de 3 meses<br />\r\n			Somente entrada única será concedida ao visto Não-Imigrante tipo “B”</td>\r\n			<td>USD$80,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>5</td>\r\n			<td>Visto de Não-Imigrante (entradas múltiplas com validade de 1 ano)</td>\r\n			<td>USD$200,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>6</td>\r\n			<td>Visto de Não-Imigrante<br />\r\n			Múltiplas entradas com validade de 5 anos para Não-Imigrante “O-X”) (Período de estadia longo- 10 anos)</td>\r\n			<td>USD$400,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>7</td>\r\n			<td>SMART Visa<br />\r\n			Múltiplas Entradas com validade de 1 até 4 anos, dependendo do contrato de trabalho do aplicante.</td>\r\n			<td>USD$400,00 (por ano de contrato)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>MAPA DO SITE</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/embaixada.php?id=64\">Sobre a Embaixada</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tailandia_breve.php\">Sobre a Tailândia</a></li>\r\n	<li><a href=\"http://www.mfa.go.th/main/en/home\" target=\"_blank\">Ministério das Relações Exteriores</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/agencia_tailandia.php?id=561\">Agências Tailandesas</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/contato.php\">Contato</a></li>\r\n</ul>\r\n\r\n<p>FAZENDO NEGÓCIOS NA TAILÂNDIA</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://www.thailandtoday.in.th/\" target=\"_blank\">Centro de Informações</a></li>\r\n	<li><a href=\"https://www.thaitrade.com/\" target=\"_blank\">Comércio</a></li>\r\n	<li><a href=\"https://www.boi.go.th/index.php?page=index\" target=\"_blank\">Investimentos (Link 1)</a></li>\r\n	<li><a href=\"https://brazilthaichamber.org/\" target=\"_blank\">Investimentos (Link 2)</a></li>\r\n	<li><a href=\"https://www.dbd.go.th/dbdweb_en/more_news.php?cid=246\" target=\"_blank\">Informações de Negócios Estrangeiros</a></li>\r\n	<li><a href=\"https://www.thaitrade.com/\" target=\"_blank\">Tailândia B2B E Web-Mercado</a></li>\r\n</ul>\r\n\r\n<p>VISITANDO A TAILÂNDIA</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.tatnews.org/general-tourism-information/\" target=\"_blank\">Informações Gerais de Turismo</a></li>\r\n	<li><a href=\"https://www.tatnews.org/\" target=\"_blank\">Autoridade do Turismo da Tailândia</a></li>\r\n	<li><a href=\"https://www.facebook.com/turismonatailandiaBR/\" target=\"_blank\">Autoridade do Turismo da Tailândia no Brasil</a></li>\r\n</ul>\r\n\r\n<p>MULTIMÍDIA</p>\r\n', '<p>Types of Thai Visas</p>\r\n\r\n<ol>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1518\" target=\"_blank\">Tourist Visa</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1499\" target=\"_blank\">Non-Immigrant Visa</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1520\" target=\"_blank\">Transit Visa</a> (temporarily suspended until further notice)</li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1522\" target=\"_blank\">Diplomatic/Official Visa</a></li>\r\n	<li><a href=\"https://thaiembassyinbrazil.com/tipos_visto.php?id_m=56&amp;id=1524\" target=\"_blank\">SMART Visa</a></li>\r\n</ol>\r\n\r\n<p>Visa Fees</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Nº</th>\r\n			<th>Categoria de Vistos</th>\r\n			<th>Taxas (Reais Brasileiros)</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>1</td>\r\n			<td>Transit Visa</td>\r\n			<td>USD$35</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2</td>\r\n			<td>Tourist Visa (Single Entry)</td>\r\n			<td>USD$40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>3</td>\r\n			<td>Tourist Visa (Multiple Entry)*</td>\r\n			<td>USD$200</td>\r\n		</tr>\r\n		<tr>\r\n			<td>4</td>\r\n			<td>Non-Immigrant Visa<br />\r\n			(single entry with 3 months validity)<br />\r\n			(Only single entry will be granted for Non-Immigrant “B”)</td>\r\n			<td>USD$80</td>\r\n		</tr>\r\n		<tr>\r\n			<td>5</td>\r\n			<td>Non-Immigrant Visa<br />\r\n			(multiple entry with 1 year validity)*</td>\r\n			<td>USD$200</td>\r\n		</tr>\r\n		<tr>\r\n			<td>6</td>\r\n			<td>Non-Immigrant Visa<br />\r\n			(Multiple entry with 5 years validity for Non-Immigrant “O-X” (Long stay 10 years) visa holders)*</td>\r\n			<td>USD$400</td>\r\n		</tr>\r\n		<tr>\r\n			<td>7</td>\r\n			<td>SMART Visa<br />\r\n			(Multiple Entry with validity ranging from 1-4 year (s) depending on work contract of applicants)*</td>\r\n			<td>USD$400 (per year of contract)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', NULL, '', '', '', '1674992837.1763-foto-N.png', 'tipos-vistos-tailandeses-taxas'),
(4, 'Legalização', 'Legalization', '', '<p>Informação geral</p>\r\n\r\n<ul>\r\n	<li>Antes do uso de um documento Brasileiro na Tailândia, o documento deve primeiro ser autenticado pelo Ministério das Relações Exteriores do Brasil e, em seguida, legalizado pela Embaixada Real da Tailândia em Brasília</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p>Documentos exigidos</p>\r\n\r\n<ul>\r\n	<li>Documentos originais autenticados, carimbados e assinados pelo Ministério das Relações Exteriores do Brasil</li>\r\n	<li>Cópia de todas as páginas dos documentos originais autenticados</li>\r\n	<li>A taxa de inscrição é de R $ 90 por carimbo / assinatura (só se aceita dinheiro)</li>\r\n</ul>\r\n', '<p>General Information</p>\r\n\r\n<p>• Prior to use of a Brazilian document in Thailand, the document must be first translated into English (if it is in Portuguese) authenticated by the Ministry of Foreign Affairs of Brazil and then legalized by the Royal Thai Embassy in Brasilia</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p>Required Documents</p>\r\n\r\n<p>• Original authenticated documents, stamped and signed by the Ministry of Foreign Affairs of Brazil </p>\r\n\r\n<p>• A copy of each document</p>\r\n\r\n<p>• The application fee is R$90 per stamp/signature (Only cash is accepted)</p>\r\n\r\n<p>• A copy the ID card/passport of applicant</p>\r\n\r\n<p> </p>\r\n', '', NULL, '', '', '', '1674992788.3591-foto-N.png', 'legalizacao'),
(5, 'Formulários', 'Forms', '', '<p>Baixar Formulários Consulares</p>\r\n\r\n<p><a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008547,2909-arquivo-0.pdf\" target=\"_blank\">1. Formulário de Solicitação de Visto</a><br />\r\n<a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008586,6342-arquivo-0.pdf\" target=\"_blank\">2. Lista para verificação de todos os documentos necessários para Solicitação de Visto</a><br />\r\n<a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008628,358-arquivo-0.pdf\" target=\"_blank\">3. Formulário T8</a></p>\r\n', '<p>Download Consular Forms</p>\r\n\r\n<p><a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008116,3073-arquivo-2.pdf\" target=\"_blank\">1. Visa Application Form</a><br />\r\n<a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008174,5487-arquivo-2.pdf\" target=\"_blank\">2. Visa Application Check List</a><br />\r\n<a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008256,3811-arquivo-2.pdf\" target=\"_blank\">3. Acknowledgement Form regarding Fit to Fly Medical Certificate and Covid-19 test results</a><br />\r\n<a href=\"https://thaiembassyinbrazil.com/img_noticias/1611008303,0945-arquivo-2.pdf\" target=\"_blank\">4. T8 Form</a><br />\r\n </p>\r\n', '', NULL, '', '', '', '1674992751.2455-foto-N.png', 'formularios'),
(6, 'Procedimentos do Serviço Consular durante a pandemia de COVID-19', 'Temporary Adjustment of Consular Services Procedures during the COVID-19 (Coronavirus Disease) Pandemic', '', '<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">Due to the ongoing outbreak of COVID-19 (Coronavirus disease) in Brazil, the Royal Thai Embassy will temporarily adjust the procedures of the consular service as follows:</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"> </div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-size:24px\"><strong>1. Consular service hours</strong></span></span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">- Tuesday and Thursday (10.00-12.00 h)</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">- Monday, Wednesday and Friday (closed/appointment only)</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">For more information or emergencies, contact <strong><a href=\"mailto:setorconsulartai@gmail.com\" style=\"box-sizing:border-box; transition-timing-function:ease-in-out; transition-duration:0.2s; color:#6f6f6f; text-decoration:none\" target=\"_blank\">sectorconsulartai@gmail.com</a></strong> </span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"> </div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-size:24px\"><strong><span style=\"background-color:#ffffff\">2. Operating procedures</span></strong></span></span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.1. Scheduling: Scheduling can be done in advance by contacting <strong><a href=\"mailto:setorconsulartai@gmail.com%C2%A0\" style=\"box-sizing:border-box; transition-timing-function:ease-in-out; transition-duration:0.2s; color:#6f6f6f; text-decoration:none\" target=\"_blank\">sectorconsulartai@gmail.com</a></strong><a href=\"mailto:setorconsulartai@gmail.com%C2%A0\" style=\"box-sizing:border-box; transition-timing-function:ease-in-out; transition-duration:0.2s; color:#6f6f6f; text-decoration:none\" target=\"_blank\"> </a></span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.2. The processing time for visas and documents can take from 1 to 7 business days. All applicants are encouraged to plan ahead and submit their applications well in advance.</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.3. Visa applications for certain nationalities can take 1 to 2 months to process.</span></span></span></span></div>\r\n', '<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">Due to the ongoing outbreak of COVID-19 (Coronavirus Disease) in Brazil, the Royal Thai Embassy will temporarily adjust consular service procedures as follows:</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"> </div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-size:24px\"><strong>1. Consular service hours</strong></span></span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      - Tuesday and Thursday (10.00-12.00 hr)</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      - Monday, Wednesday, Friday (Closed/appointment only)</span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">For more information or emergencies, please contact <strong><a href=\"mailto:setorconsulartai@gmail.com\" style=\"box-sizing:border-box; transition-timing-function:ease-in-out; transition-duration:0.2s; color:#6f6f6f; text-decoration:none\" target=\"_blank\">sectorconsulartai@gmail.com</a></strong> </span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"> </div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\"><span style=\"font-size:24px\"><strong>2. Operating procedures</strong></span></span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.1 Appointment: Appointments can be made in advance by contacting <strong><a href=\"mailto:setorconsulartai@gmail.com\" style=\"box-sizing:border-box; transition-timing-function:ease-in-out; transition-duration:0.2s; color:#6f6f6f; text-decoration:none\" target=\"_blank\">sectorconsulartai@gmail.com</a></strong> </span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.2 Visa and document processing time can take up to 1-7 working days. All applicants are encouraged to plan ahead and submit their applications well in advance. </span></span></span></span></div>\r\n\r\n<div style=\"-webkit-text-stroke-width:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:Roboto,sans-serif\"><span style=\"background-color:#ffffff\">      2.3 Visa applications for certain nationalities may take up to 1-2 months to process.</span></span></span></span></div>\r\n', '', NULL, '', '', '', '1674992932.7193-foto-N.png', 'procedimentos-servico-consular-durante-pandemia-covid19');
