INSERT INTO `tbl_solucoes` (`id`, `titulo`, `postado_por`, `conteudo`, `data_postagem`, `especialidade`, `foto`, `breve`, `meta_title`, `meta_keywords`, `meta_description`, `foto1`, `url_amigavel`, `descricao_imagem`, `legenda_imagem`, `embed`) VALUES
(1, 'Condomínios residenciais', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A Pico Solar tecnologia oferece projetos de sistema de geração de energia elétrica para condomínios residenciais que possibilitam reduzir o custo de energia elétrica a praticamente ZERO e garantir os preços futuros da energia consumida pelo condomínio (evitando as altas imprevistas). </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A geração em condomínios pode ser voltada a suprir somente o consumo das áreas coletivas (que fazem parte do custo da taxa de condomínio) como elevador, iluminação, segurança entre outros. Ou ainda, a geração pode ser focada nas áreas coletivas e parte ou a integralidade do consumo dos moradores do condomínio. </span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente!</span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610135736.11-foto-N.jpg', '', 'Condomínios residenciais - Pico Solar | Energia Solar em Brasília -DF', '', 'A Pico Solar oferece projetos de sistema de geração de energia elétrica para condomínios residenciais em Brasília - DF', NULL, 'condominios-residenciais', '', '', ''),
(2, 'Residências', NULL, '<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Para reduzir a sua conta de energia residencial, a Pico Solar oferece o sistema de geração de energia elétrica a partir de energia solar para residências, que possibilita reduzir o custo de energia elétrica a praticamente ZERO e garantir economia nos preços futuros da energia consumida por você e sua família (evitando altas imprevistas). </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Você pode gerar energia elétrica para todo o consumo da sua casa e família, economizando até 95% da sua conta de energia e ficando independente de altas de preços inesperadas ou de problemas de racionamento de energia. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente! </span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610138687.17-foto-N.jpg', '', 'Residências - Pico Solar | Energia Solar em Brasília -DF', '', ' Pico Solar oferece o sistema de geração de energia elétrica a partir de Energia Solar para Residências em Brasília -DF', NULL, 'residencias', '', '', ''),
(3, 'Áreas Rurais', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Para reduzir a conta de energia da sua propriedade rural, a Pico Solar oferece o sistema de geração de energia elétrica a partir de energia solar para casas em áreas rurais ou áreas isoladas (que não dispõem de rede elétrica) e possibilitam reduzir o custo de energia elétrica a praticamente ZERO, além de garantir os preços futuros da energia consumida por você e a sua família (evitando as altas imprevistas).</span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Você pode gerar a sua energia elétrica para o consumo de sua casa e família economizando até 95% de sua conta de energia e ficando independente de altas de preços inesperadas, ou de problemas de racionamento de energia. E ainda, se a sua chácara ou sítio estiverem no mesmo Estado de sua residência, você pode gerar excedentes para descontar na conta de energia da área urbana.</span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas da conta de energia, e ainda proteja o meio ambiente!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610136017.93-foto-N.jpg', '', 'Áreas Rurais - Pico Solar | Energia Solar em Brasília -DF | (61) 98296-5547', '', 'A Pico Solar oferece o sistema de energia  solar para casas em Áreas Rurais ou Áreas Isoladas em Brasília - DF', NULL, 'Areas-rurais', '', '', ''),
(4, 'Shoppings', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Um dos maiores custos de uma empresa é o de energia elétrica. Em empreendimentos como os Shoppings Centers, existe um consumo elevado de energia elétrica para o processo de iluminação e climatização.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Além disso, os consumidores atualmente estão buscando produtos e locais que correspondam com os padrões atuais de sustentabilidade, que contemplem o uso de energia renovável e o consumo consciente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Assim, reduzir esse custo representa aumento de ganhos e de competitividade das lojas presentes no Shopping e ainda eleva o empreendimento a um nível de sustentabilidade. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Para reduzir a sua conta de energia, a Pico Solar oferece o sistema de geração de energia elétrica a partir de geração de energia solar ajustado a sua demanda, reduzindo os custos de consumo em horários de pico ou até reduzindo o custo de energia elétrica da rede a praticamente ZERO e garantindo os preços futuros da energia consumida por sua empresa (evitando as altas imprevistas).</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O empreendimento pode gerar a sua energia elétrica necessária para cobrir todo o consumo de sua conta de energia e ficando independente de altas de preços inesperadas ou de possíveis problemas de racionamento de energia.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas da conta de energia, e ainda proteja o meio ambiente!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610137932.72-foto-N.jpg', '', 'Shoppings - Pico Solar | Energia Solar em Brasília -DF', '', 'A Pico Solar te ajuda a reduzir custos com Energia das lojas presentes no Shopping em Brasília - DF', NULL, 'shoppings', '', '', ''),
(5, 'Condomínios Empresariais', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Centros comerciais e empresariais consomem grandes quantidades de energia e este consumo equivale a elevados custos aos empresários e lojistas.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Hoje esses condomínios empresariais podem reduzir a conta de energia com a Pico Solar através do uso de sistemas de geração de energia elétrica a partir de geração solar. E que ainda pode reduzir o custo de energia elétrica a praticamente ZERO e garantir os preços futuros da energia consumida pelo condomínio (evitando as altas imprevistas).</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610135809.52-foto-N.jpg', '', 'Condomínios Empresariais - Pico Solar | Energia Solar em Brasília -DF', '', 'Hoje Condomínios Empresariais em Brasília - DF podem reduzir a conta de energia com a Pico Solar.', NULL, 'condominios-empresariais', '', '', ''),
(6, 'Indústria', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O nível de consumo de energia do setor industrial é elevado, apesar de as indústrias disporem de tarifas diferenciadas, reduzidas em relação ao consumidor residencial, porém em função do elevado consumo, acaba se tornando em um dos maiores da produção dos produtos.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A saída está na adoção de geração de energia a partir da energia solar, com as soluções da Pico Solar para os sistemas de geração fotovoltaica.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">O uso desse tipo de energia é viável para de todos os portes e tipos de empreendimentos industriais, em especial porque esse tipo de empresa, em geral, dispõe de área para a instalação dos painéis fotovoltaicos. É possível reduzir o custo de energia elétrica em parte ou a praticamente ZERO e garantir os preços futuros da energia consumida por sua empresa (evitando as altas imprevistas), adotar a produção de acordo com padrões de sustentabilidade e qualidade de produtos de nível internacional.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">E ainda, se sua empresa detiver mais de uma unidade, e estas estiverem no mesmo Estado, você pode gerar excedentes em um empreendimento e repassar para outro empreendimento vinculado ao mesmo CPF ou CNPJ.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Visto que a geração de energia elétrica também pode ser um investimento rentável para aquele investidor que deseja trabalhar com um ativo de alta qualidade e que gera recursos mensalmente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610135867.07-foto-N.jpeg', '', 'Indústria - Pico Solar | Energia Solar em Brasília -DF', '', 'A Pico Solar oferece soluções em Energia Solar para de todos os portes e tipos de Indústrias em Brasília - DF', NULL, 'industria', '', '', ''),
(7, 'Agronegócio', NULL, '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A produção agrícola da atualidade incorpora cada vez mais elementos de consumo de energia elétrica, especialmente para aquecimento de suínos e aves, sistemas de ordenha, beneficiamento de produtos, de resfriamento de produtos, de irrigação de cultivos, de climatização em criatórios de animais ou de estufas de produção, ou ainda de uso de energia em pontos isolados da propriedade, onde não existe rede elétrica disponível.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Os custos de energia estão cada vez maiores e acabam impactando os preços dos produtos agrícolas, reduzindo as margens dos produtores e dificultando o dia-a-dia de quem produz para consumo interno ou para exportação.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">A Pico Solar propõe a adoção de uso de geração de energia elétrica a partir de sistema de geração solar para suprir a demanda dos empreendimentos do agronegócio, adicionando uma redução de custos a produção e um nível de qualidade ambiental aos produtos que representa mais competitividade a produção mais competitiva do mundo, a Brasileira.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente!</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n', NULL, NULL, '1610136526.38-foto-N.jpg', '', 'Agronegócio - Pico Solar | Energia Solar em Brasília -DF', '', 'A Pico Solar propõe a adoção de Energia Solar para suprir a demanda dos empreendimentos do agronegócio em Brasília - DF', NULL, 'agronegocio', '', '', ''),
(8, 'Usinas Solares', NULL, '<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A Pico Solar, em parceria com uma das maiores produtoras de equipamentos de geração de energia fotovoltaica, disponibiliza soluções para a geração em escala (do inglês \"<em>utility scale</em>\") e grandes volumes de energia concentrados em uma única planta. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Tornando possível contemplar as demandas de energia elétrica tanto para a venda a distribuidoras, como para o abastecimento de cidades, empresas, instituições ou ainda servir de fonte de renda a possíveis investidores que desejam produzir ganhos elevados por meio de vendas de energia.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Geração de energia elétrica também pode ser um investimento rentável para aquele investidor que deseja trabalhar com um ativo de alta qualidade e que gera recursos mensalmente.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">A Pico Solar oferece diversos tamanhos de usinas de geração solar para todos os tipos de investidores. Com os diferentes tamanhos de projeto:</span></span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Usinas de geração de energia solar de pequeno porte até 75 kilowatt de potência instalada que podem suprir diversos tipos de consumo, desde uma pequena vila até um pequeno empreendimento</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Usinas de geração de energia elétrica a partir de energia solar de médio porte, com potências entre 75 kilowatt e 10 mega watt, que podem suprir diversos tipos de consumo, desde uma pequena cidade, ilha ou até um mesmo empreendimentos.</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:18px\">Usinas de geração de energia elétrica a partir de energia solar de grande porte maiores do que 10 mega watt de potência que podem suprir diversos tipos de consumo, desde uma pequena cidade, vendas de energia no mercado livre, venda de energia para distribuidoras até grandes empreendimentos.</span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n\r\n<p><span style=\"font-family:Open Sans,sans-serif\">Economize na sua conta de energia, fuja das altas inesperadas, e ainda proteja o meio-ambiente!</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-family:Open Sans,sans-serif\"><span style=\"font-size:22px\"><strong>Com energia solar, você tem muito mais!</strong></span></span><br />\r\n </p>\r\n\r\n<p><span style=\"font-family:Open Sans,sans-serif\">Confira todos os benefícios que você pode desfrutar com o Sistema Pico Solar:<br />\r\n<br />\r\n<strong>+ Economia</strong><br />\r\nReduza o valor da sua conta de luz em até 98%. Pague apenas pela taxa obrigatória da concessionária.<br />\r\n<br />\r\n<strong>+ Energia</strong><br />\r\nAtravés do sol produzimos uma energia renovável, que mesmo em dias mais nublados te garante energia limpa, natural e infinita.<br />\r\n<br />\r\n<strong>+ Vida útil</strong><br />\r\nO Sistema de energia solar tem baixa necessidade de manutenção. Após instalado o sistema, os cuidados preventivos envolvem apenas limpeza e fiscalização dos painéis solares.<br />\r\n<br />\r\n<strong>+ Sustentabilidade</strong><br />\r\nA energia solar é uma grande aliada na redução da poluição e das taxas de carbono no meio ambiente.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Open Sans,sans-serif\"><strong>Venha para a Pico Solar e faça parte do futuro!</strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"> </p>\r\n', NULL, NULL, '1610127144.96-foto-N.jpg', '', 'Usinas Solares - Energia Solar em Brasília -DF | (61) 98296-5547', '', 'A Pico Solar disponibiliza soluções para a geração em  grandes volumes de energia para usinas em Brasília - DF', NULL, 'usinas-solares', '', '', '');
