INSERT INTO `tbl_testemunhos` (`id`, `nome`, `testemunho`, `foto`, `sexo`) VALUES
(1, 'Eldevan Lobo', 'Já andei em vários restaurantes, mas esse é de longe o melhor. Ótimo atendimento e bons pratos. Recomendo!', '1605296481.98-foto-N.png', 'M'),
